import React, {Component} from 'react';
import './App.css';
import {BrowserRouter, Switch} from 'react-router-dom';
import Home from './Containers/Home/Home';
import About from './Containers/About/About';
import Shop from './Containers/Shop/Shop';
import { Route} from 'react-router-dom';
import ProductList from './Components/Shop/ProductList'



class App extends Component {


  render() {
    return (
    <div className="App">
      <BrowserRouter>

      <Switch>
      <Route path="/" exact component={Home} />
      <Route path="/about" component={About} />

      <Route path="/shop" component={Shop}/>

      <Route path="/shop/all" exact render={() => {<ProductList returnLocation="all" />}} />
          <Route path="/shop/ring" render={() => {<ProductList returnLocation="ring" />}} />
          <Route path="/bracelets" render={() => {<ProductList returnLocation="bracelets" />}} />
          <Route path="/necklaces" render={() => {<ProductList returnLocation="necklaces" />}} />
          <Route path="/earrings" render={() => {<ProductList returnLocation="earrings" />}} />
      </Switch>
      </BrowserRouter>
    </div>

  );
  }
}


export default App;
